selector_to_html = {"a[href=\"#naturlige-tal\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2.2. </span>Naturlige tal<a class=\"headerlink\" href=\"#naturlige-tal\" title=\"Permalink til denne overskrift\">#</a></h2><p>De naturlige tal er dem, som vi t\u00e6ller p\u00e5 vores fingre. Derfor kaldes de ogs\u00e5 t\u00e6lletallene. Det var dem, som vores historie startede med. Vi ben\u00e6vner samlingen af disse tal med N. Det vil sige, at N er m\u00e6ngden af de naturlige tal og vi kan ogs\u00e5 angive den p\u00e5 listeform:</p>", "a[href=\"#lige-og-ulige-tal\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2.3.1. </span>Lige og ulige tal<a class=\"headerlink\" href=\"#lige-og-ulige-tal\" title=\"Permalink til denne overskrift\">#</a></h3><p>I de hele tal har vi ogs\u00e5 en anden interessant inddeling, nemlig de lige og ulige tal. De lige tal er for eksempel tallene <span class=\"math notranslate nohighlight\">\\(4\\)</span>, <span class=\"math notranslate nohighlight\">\\(8\\)</span> og <span class=\"math notranslate nohighlight\">\\(\u221212\\)</span>, og de ulige tal for eksempel tallene <span class=\"math notranslate nohighlight\">\\(5\\)</span>, <span class=\"math notranslate nohighlight\">\\(23\\)</span> og <span class=\"math notranslate nohighlight\">\\(\u221241\\)</span>.</p>", "a[href=\"#reelle-tal\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2.5. </span>Reelle tal<a class=\"headerlink\" href=\"#reelle-tal\" title=\"Permalink til denne overskrift\">#</a></h2><p>Som n\u00e6vnt tidligere, s\u00e5 udfylder de rationale tal ikke alle hullerne p\u00e5 tallinjen - vi mangler nemlig de irrationale tal. De irrationale tal er de tal, der ikke kan skrives som br\u00f8ker med heltal i t\u00e6ller og n\u00e6vner. Det vil sige, at irrationale tal er alts\u00e5 tal, der har uendeligt mange decimaler, der ikke har et system i sig. Vi har ikke noget symbol for de irrationale tal, men som eksempel kan vi n\u00e6vne <span class=\"math notranslate nohighlight\">\\(\\pi\\)</span>, <span class=\"math notranslate nohighlight\">\\(\\sqrt{2}\\)</span> og <span class=\"math notranslate nohighlight\">\\(e\\)</span> (Eulers tal), der alle er irrationale.</p><p>Vi slutter talm\u00e6ngderne af med de reelle tal. De reelle tal er en samling af de rationale og irrationale tal. De reelle tal vil derfor ogs\u00e5 udfylde alle hullerne i tallinjen. Hvis du tegner en tallinje, s\u00e5 tegner du faktisk p\u00e5 samme tid de reelle tal. De reelle tal er samlingen af alle de tal, som du kan komme i tanke om og vi ben\u00e6vner de reelle tal med <span class=\"math notranslate nohighlight\">\\(\\mathbb{R}\\)</span>.</p>", "a[href=\"#en-fortaelling-om-tallenes-udvikling\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2.1. </span>En fort\u00e6lling om tallenes udvikling<a class=\"headerlink\" href=\"#en-fortaelling-om-tallenes-udvikling\" title=\"Permalink til denne overskrift\">#</a></h2><p>I gamle dage havde man i princippet kun brug for de naturlige tal</p>", "a[href=\"#rationale-tal\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2.4. </span>Rationale tal<a class=\"headerlink\" href=\"#rationale-tal\" title=\"Permalink til denne overskrift\">#</a></h2><p>Br\u00f8ker og kommatal med endeligt antal decimaler eller system i decimalerne tilh\u00f8rer de rationale tal. Faktisk er det netop med br\u00f8ker, vi definerer de rationale tal ved. Alle tal, der kan skrives som en br\u00f8k, er et rationalt tal. Derfor er <span class=\"math notranslate nohighlight\">\\(4\\)</span> ogs\u00e5 et rationalt tal, da det kan skrives som <span class=\"math notranslate nohighlight\">\\(\\frac{4}{1}\\)</span>. De rationale tal ben\u00e6vner vi med <span class=\"math notranslate nohighlight\">\\(\\mathbb{Q}\\)</span>. Denne m\u00e6ngde af tal kan ikke p\u00e5 samme m\u00e5de opskrives som <span class=\"math notranslate nohighlight\">\\(\\mathbb{N}\\)</span> og <span class=\"math notranslate nohighlight\">\\(\\mathbb{Z}\\)</span>. I stedet skriver vi</p>", "a[href=\"#heltal\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2.3. </span>Heltal<a class=\"headerlink\" href=\"#heltal\" title=\"Permalink til denne overskrift\">#</a></h2><p>De hele tal var udvidelsen af de naturlige tal med tallet 0 og de negative tal. M\u00e6ngden af hele tal best\u00e5r derfor b\u00e5de af de naturlige tal og deres modsatte tal. Tallet 2 og \u22122 er modsatte tal og er indeholdt i heltallene. Vi ben\u00e6vner samlingen af heltallene med Z (efter det tyske \u201dZahl\u201d, der betyder tal). Vi kan ogs\u00e5 angive denne p\u00e5 listeform:</p>", "a[href=\"#talmaengder\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2. </span>Talm\u00e6ngder<a class=\"headerlink\" href=\"#talmaengder\" title=\"Permalink til denne overskrift\">#</a></h1><p>I Kapitel 1 l\u00e6rte vi en masse om tal og approksimationer. Men snakken er ikke f\u00e6rdig endnu. I m\u00e6ngdeteorien inddeler vi tallene i det, som vi kalder <em>talm\u00e6ngder</em>. Inddelingen af tal skyldes b\u00e5de talhistorie, men ogs\u00e5 f\u00e6lles egenskaber ved tallene.</p><p>Inden vi g\u00e5r mere teoretisk til v\u00e6rks, s\u00e5 gennemg\u00e5r vi en historie, som kunne have v\u00e6ret motivation til udviklingen af disse inddelinger.</p>", "a[href=\"#talmaengdernes-indbyrdes-forhold\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2.2.6. </span>Talm\u00e6ngdernes indbyrdes forhold<a class=\"headerlink\" href=\"#talmaengdernes-indbyrdes-forhold\" title=\"Permalink til denne overskrift\">#</a></h2><p>Som du m\u00e5ske allerede har bem\u00e6rket, s\u00e5 har disse m\u00e6ngder noget tilf\u00e6lles. Kigger vi p\u00e5 heltallene <span class=\"math notranslate nohighlight\">\\(\\mathbb{Z}\\)</span>, s\u00e5 kan vi se, at alle de naturlige tal $\\mathbb{N} ogs\u00e5 indg\u00e5r i m\u00e6ngden af hele tal. Vi siger, at de naturlige tal er en delm\u00e6ngde af heltallene. Det skrives</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
